import { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { weatherService } from '../../services/api';
import {
  Container,
  Typography,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Alert,
  CircularProgress,
  Box,
  Chip,
} from '@mui/material';
import { History, TrendingUp, AccessTime, LocationOn } from '@mui/icons-material';
import { styled } from '@mui/material/styles';

const StyledTableContainer = styled(motion(TableContainer))`
  backdrop-filter: blur(16px);
  background: rgba(245, 245, 220, 0.85);
  border-radius: 24px;
  box-shadow: 0 8px 32px rgba(0, 0, 0, 0.1);
  overflow: hidden;
  border: 1px solid rgba(255, 255, 255, 0.2);
  width: 100%;
  margin: 0 auto;
`;

const GradientBackground = styled(Box)`
  min-height: 100vh;
  background: linear-gradient(135deg, #2c2c2c 0%, #1a1a1a 100%);
  padding: 3rem 0;
  font-family: 'Poppins', sans-serif;
  width: 100%;
  overflow-x: hidden;
`;

const StyledTableRow = styled(TableRow)`
  &:nth-of-type(odd) {
    background: rgba(245, 245, 220, 0.05);
  }
  &:hover {
    background: rgba(245, 245, 220, 0.1);
    transform: scale(1.01);
    transition: all 0.3s ease;
  }
`;

const StyledTableCell = styled(TableCell)`
  color: #f5f5dc;
  font-family: 'Poppins', sans-serif;
  border-bottom: 1px solid rgba(245, 245, 220, 0.1);
`;

const StyledTableHeadCell = styled(TableCell)`
  color: #f5f5dc;
  font-family: 'Lora', serif;
  font-weight: 600;
  font-size: 1.1rem;
  border-bottom: 2px solid rgba(245, 245, 220, 0.2);
`;

const container = {
  hidden: { opacity: 0 },
  show: {
    opacity: 1,
    transition: {
      staggerChildren: 0.1,
      delayChildren: 0.3
    }
  }
};

const item = {
  hidden: { opacity: 0, y: 20, scale: 0.9 },
  show: { 
    opacity: 1, 
    y: 0, 
    scale: 1,
    transition: {
      type: "spring",
      stiffness: 100,
      damping: 10
    }
  }
};

const StatCard = styled(motion(Paper))`
  background: rgba(245, 245, 220, 0.1);
  padding: 1.5rem;
  border-radius: 16px;
  text-align: center;
  backdrop-filter: blur(8px);
  border: 1px solid rgba(245, 245, 220, 0.1);
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

export default function WeatherHistory() {
  const [searches, setSearches] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);
  const [stats, setStats] = useState({
    totalSearches: 0,
    uniqueCities: 0,
    lastSearch: null
  });

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const response = await weatherService.getSearchHistory();
        setSearches(response.data);

        // Calculate stats
        const uniqueCities = new Set(response.data.map(s => s.city)).size;
        const lastSearch = response.data[0]?.searchedAt;

        setStats({
          totalSearches: response.data.length,
          uniqueCities,
          lastSearch
        });
      } catch (err) {
        setError(err.response?.data?.message || 'Failed to fetch search history');
      } finally {
        setLoading(false);
      }
    };

    fetchHistory();
  }, []);

  if (loading) {
    return (
      <GradientBackground>
        <Container 
          maxWidth="lg" 
          sx={{ 
            display: 'flex', 
            justifyContent: 'center', 
            alignItems: 'center',
            minHeight: '50vh'
          }}
        >
          <motion.div
            initial={{ opacity: 0, scale: 0.5, rotate: 0 }}
            animate={{ opacity: 1, scale: 1, rotate: 360 }}
            transition={{ duration: 0.8, type: "spring" }}
          >
            <CircularProgress size={80} sx={{ color: '#f5f5dc' }} />
          </motion.div>
        </Container>
      </GradientBackground>
    );
  }

  return (
    <GradientBackground>
      <Container 
        maxWidth="lg"
        sx={{
          px: { xs: 2, sm: 3, md: 4 }, // Responsive padding
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          width: '100%'
        }}
      >
        <motion.div
          initial={{ opacity: 0, y: -30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.7, type: "spring" }}
          style={{ width: '100%' }}
        >
          {/* Title Section */}
          <Box 
            sx={{ 
              textAlign: 'center',
              mb: 6,
              width: '100%'
            }}
          >
            <Typography 
              variant="h2" 
              component="h1" 
              sx={{ 
                color: '#f5f5dc',
                fontFamily: 'Lora, serif',
                fontWeight: 700,
                textShadow: '2px 2px 4px rgba(0,0,0,0.3)',
                fontSize: { xs: '2.5rem', sm: '3rem', md: '3.5rem' },
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                gap: 2
              }}
            >
              <History sx={{ fontSize: 'inherit' }} />
              Weather Search History
            </Typography>
          </Box>

          {/* Stats Section */}
          <Box 
            sx={{ 
              display: 'grid',
              gridTemplateColumns: {
                xs: '1fr',
                sm: 'repeat(2, 1fr)',
                md: 'repeat(3, 1fr)'
              },
              gap: 3,
              mb: 5,
              width: '100%'
            }}
          >
            <StatCard variants={item}>
              <TrendingUp sx={{ fontSize: 40, color: '#f5f5dc', mb: 2 }} />
              <Typography variant="h4" sx={{ color: '#f5f5dc', fontFamily: 'Poppins' }}>
                {stats.totalSearches}
              </Typography>
              <Typography sx={{ color: '#f5f5dc', opacity: 0.8 }}>
                Total Searches
              </Typography>
            </StatCard>

            <StatCard variants={item}>
              <LocationOn sx={{ fontSize: 40, color: '#f5f5dc', mb: 2 }} />
              <Typography variant="h4" sx={{ color: '#f5f5dc', fontFamily: 'Poppins' }}>
                {stats.uniqueCities}
              </Typography>
              <Typography sx={{ color: '#f5f5dc', opacity: 0.8 }}>
                Unique Cities
              </Typography>
            </StatCard>

            <StatCard variants={item}>
              <AccessTime sx={{ fontSize: 40, color: '#f5f5dc', mb: 2 }} />
              <Typography variant="h6" sx={{ color: '#f5f5dc', fontFamily: 'Poppins' }}>
                {stats.lastSearch ? new Date(stats.lastSearch).toLocaleString() : 'N/A'}
              </Typography>
              <Typography sx={{ color: '#f5f5dc', opacity: 0.8 }}>
                Last Search
              </Typography>
            </StatCard>
          </Box>

          {/* Table Section */}
          <Box sx={{ width: '100%', overflowX: 'auto' }}>
            <StyledTableContainer
              component={Paper}
              initial={{ opacity: 0, y: 50 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.7, type: "spring" }}
            >
              <Table sx={{ minWidth: 650 }}>
                <TableHead>
                  <TableRow>
                    <StyledTableHeadCell width="15%">City</StyledTableHeadCell>
                    <StyledTableHeadCell width="15%">Temperature</StyledTableHeadCell>
                    <StyledTableHeadCell width="20%">Description</StyledTableHeadCell>
                    <StyledTableHeadCell width="15%">Humidity</StyledTableHeadCell>
                    <StyledTableHeadCell width="15%">Wind Speed</StyledTableHeadCell>
                    <StyledTableHeadCell width="20%">Searched At</StyledTableHeadCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {searches.map((search, index) => (
                    <StyledTableRow
                      key={search.id}
                      component={motion.tr}
                      variants={item}
                      whileHover={{ scale: 1.01 }}
                      whileTap={{ scale: 0.99 }}
                    >
                      <StyledTableCell>
                        <Chip 
                          label={search.city}
                          sx={{ 
                            background: 'rgba(245, 245, 220, 0.2)',
                            color: '#f5f5dc',
                            fontFamily: 'Poppins',
                            width: 'fit-content'
                          }}
                        />
                      </StyledTableCell>
                      <StyledTableCell>{search.temperature}Â°C</StyledTableCell>
                      <StyledTableCell sx={{ textTransform: 'capitalize' }}>
                        {search.description}
                      </StyledTableCell>
                      <StyledTableCell>{search.humidity}%</StyledTableCell>
                      <StyledTableCell>{search.windSpeed} m/s</StyledTableCell>
                      <StyledTableCell>
                        {new Date(search.searchedAt).toLocaleString()}
                      </StyledTableCell>
                    </StyledTableRow>
                  ))}
                </TableBody>
              </Table>
            </StyledTableContainer>
          </Box>
        </motion.div>
      </Container>
    </GradientBackground>
  );
